import React from 'react'
import {Link} from 'react-router-dom'
const LinkRoute = ({tabs}) => {
        <div>
              {tabs.map(tab=>
                <Link className="nav-link"
                activeClass="active"
                to={tab.link} >{tab.text}</Link>
			      )}
        </div>

}
export default LinkRoute
